import '../../assets/styles/header.css'
import Particles from "react-tsparticles";
import {loadFull} from "tsparticles";

function Header() {
    Particles.init({
        selector: '.background',
        color: ['#00ffb1', '#ff0943', '#4112ac'],
        connectParticles: true,
    })

    return (
        <header>
            <canvas className="background">

            </canvas>
            Publish your ideas
        </header>

    );
}

export default Header;
